button.onclick:
clearTable("PersonnesACT");
// Get valeurs

  var /*Date*/ Debut = meibo.getFieldValue('DateDebut');
  var /*Date*/ Fin = meibo.getFieldValue('DateFin');


 //Format date xxxx-xx-xx

  var /*String*/ date = Debut.substring(0,4)+ "-" +Debut.substring(4,6)+ "-" +Debut.substring(6,8);
  var /*int*/ jour= parseInt(Debut.substring(6,8));

  // Filters

  var /*String*/ filter = "";
  var /*String*/ filter1 = "";  
  var /*String*/ FLT2 = "";

  var /*int*/ cont;  
  var filters= new Array(8);

  for(cont=0;cont<=7;cont++)
  {

        var /*int*/ prochain= jour+cont;

       if( (prochain > 0) && (prochain < 10)  ){
         filter1 = Debut.substring(0,4)+ "-" + Debut.substring(4,6) + "-0" +prochain;
       }

        else{
           filter1 = Debut.substring(0,4)+ "-" +  Debut.substring(4,6) + "-" +prochain;
        }

        filter=  filter + " TCT_START_DATE = " + "'" + filter1 + "' OR";
        FLT2= filter.substring(0,filter.length - 3);        

  }

  meibo.getField("filter").setValue(FLT2);


  //Recherche et afichage table 1

  var /*ResultSet*/ resultSet = meibo.executeResource('Event', FLT2, 0, '');
  var /*int*/ nEntries = resultSet.getEntryCount();
  if (nEntries != 0) 
  {   
      //meibo.showField("searchContainer", true);
      meibo.showField("error1", false);

      displaySearchA('Event', meibo.getFieldValue("attributeList"));
  }

  else {
          meibo.showField("error1", true);
       }

